document.addEventListener("DOMContentLoaded",function(){var e={};if(e.inputs=document.querySelectorAll("[data-search-js-input]"),e.inputs)for(var t=0;t<e.inputs.length;t++)e.inputs[t].addEventListener("keyup",function(){var e=document.querySelectorAll('[data-search-js-container="'+this.getAttribute("data-search-js-input")+'"] > [data-search-js-value]');if(e)for(var t=0;t<e.length;t++)e[t].style.display=0===this.value.length||e[t].getAttribute("data-search-js-value").toLowerCase().indexOf(this.value.toLowerCase())>-1?"block":"none"})});